import axios from "axios";
import choosenSong from "./songsList";

function todaysSong() {
  const song = choosenSong()
  axios.get(`https://youtube.googleapis.com/youtube/v3/search?part=snippet&q=${song}&key=AIzaSyCjkUBCiehi5ElDfmHy5-_h8yReodwjUQs
  `)
  .then(res => console.log(res.data))
}


// https://www.youtube.com/watch?v=

export default todaysSong
